let loadMaterials = () => {
    for (let material of materialsList) {
        if (material.imageData != undefined && material.imageData != "") {
            ImageData.fromBase64Alt(function (i) {
                material.image = i;
                material.slicedImage = i.data.slice(sliceRows * 4 * 36, i.data.length);
            }, material.imageData);
        }
    }
};

let compareMats = (slot) => {
    let slicedImg = slot.buffer.data.slice(sliceRows * 4 * 36, slot.buffer.data.length);

    //   // create off-screen canvas element
	// 	var canvas = document.createElement('canvas'),
	// 	ctx = canvas.getContext('2d');

	// 	canvas.width = 36;
	// 	canvas.height = 32 - sliceRows;

	// 	// create imageData object
	// 	var idata = ctx.createImageData(36, 32 - sliceRows);

	// 	// set our buffer as source
	// 	idata.data.set(slicedImg);

	// 	// update canvas with new data
	// 	ctx.putImageData(idata, 0, 0);
    //     var dataUri = canvas.toDataURL(); // produces a PNG file
    //     console.log(dataUri);

    for (let material of materialsList) {
        if (material.image != undefined) {
            let imgToCompare = material.slicedImage;

            let diff = pixelmatch(imgToCompare, slicedImg, null, 36, 32 - sliceRows, {threshold: 0.05});
            
            // if (diff > 90 && diff < 200) {
            //     console.log(diff + ' ' + material.name)
            // }
            if (diff < 50) {
                // console.log(diff + ' ' + material.name)
                // console.log("Diff: " + diff);
                materialsCount[material.name] = slot.amount;

                return material.name;
            }
        }
    }
};

